import React from 'react'
import LibrarySong from './LibrarySong'
const Library = ({setCurrentSong, currentSong, songs, audioRef, isplaying}) => {
  return (
    <div className='library'>
        <h2>Library</h2>
        <div className="library-songs">
            {songs.map(song => <LibrarySong song={song} songs={songs} setCurrentSong={setCurrentSong} key={song.id} audioRef={audioRef} isplaying={isplaying} currentSong={currentSong}/> )}
        </div>
    </div>
  )
}

export default Library
